import React from 'react';
import "./footer.css"

import logo from "../../assets/logo.png";
import { Phone } from '@mui/icons-material';
import GitHubIcon from '@mui/icons-material/GitHub';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailIcon from '@mui/icons-material/Email';

const Footer = () => {
    return (
        <div className='footer-container'>
            <hr />
            <div className='footer'>
                <div className='social-links'>
                    <GitHubIcon sx={{fontSize,color:"white" ,"&:hover": { color: `var(--orange)` } }}/>
                    <InstagramIcon sx={{ "&:hover": { color: `var(--orange)` } }}/>
                    <LinkedInIcon sx={{ "&:hover": { color: `var(--orange)` } }}/>
                </div>
                <div className='logo-f'>
                    <img src={logo} alt="" />
                </div>
                <div>
                    <div>
                        <span><Phone/></span>
                        <span>06 10 10 47 28 </span>
                    </div>
                    <div>
                        <span><EmailIcon /> </span>
                        <span>fit-club@gmail.com </span>
                    </div>
                </div>
            </div>
            <div className='blur blur-footer-1'></div>
            <div className='blur blur-footer-2'></div>
        </div>
    );
};

export default Footer;
